import React, { Component, useState, useRef } from 'react';
import { loadFriends } from '../functions'

function Friends(props) {

  const [friends, setFriends] = useState([])
  console.log(friends)

  useEffect(() => {
    loadFriends(props.id).then(data => setFriends(data))
  }, [])

  return (
    {createFriends}

  )
}

